import './App.css';
import Footer from './components/Footer/Footer';
import Header from './components/Header/Header';
import Product from './components/Product/Product';
import {BrowserRouter, Route} from 'react-router-dom'


function App() {
  return (
    <div className="App">
      <BrowserRouter>
  <Route></Route>
    <Header/>
    <Product/>

    <Footer/>
      </BrowserRouter>
    </div>
  );
}

export default App;
